from stores.Itbox.itbox_info import WACOM_PAGE_URLS, XP_PEN_PAGE_URLS, XP_PEN_ACTICLESfrom stores.Itbox.itbox_model import ItboxStoredef start_itbox_wacom():    itbox = ItboxStore(WACOM_PAGE_URLS)    items = itbox.generate_info()    return itbox.compare_data(items)def start_itbox_xp_pen():    itbox = ItboxStore(XP_PEN_PAGE_URLS)    items = itbox.generate_info()    return itbox.compare_all_data(items, XP_PEN_ACTICLES)